import React, { useState } from 'react';
import './App.css';
import Signup from './components/Signup';
import Login from './components/Login';

function App() {
  const [showLogin, setShowLogin] = useState(false);
  const [showSignup, setShowSignup] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // New state for login status

  const handleLoginClick = () => {
    setShowLogin(!showLogin);
    setShowSignup(false);
  };

  const handleSignupClick = () => {
    setShowSignup(!showSignup);
    setShowLogin(false);
  };

  const handleLogout = () => {
    // Implement your logout logic here
    setIsLoggedIn(false);
  };

  const handleLoginSuccess = () => {
    // Set the login status to true upon successful login
    setIsLoggedIn(true);
    setShowLogin(false); // Close the login form
    setShowSignup(false); // Close the signup form
  };

  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="/">
        Auto<span>t</span>ask
        </a>
        <div className="navbar-collapse justify-content-end">
          {isLoggedIn ? (
            <>
              <p className="navbar-text">Welcome</p>
              <button className="btn nav-link" onClick={handleLogout}>
                Logout
              </button>
            </>
          ) : (
            // Show login and signup buttons if not logged in
            <ul className="navbar-nav">
              <li className="nav-item">
                <button className="btn nav-link" onClick={handleLoginClick}>
                  Login
                </button>
              </li>
              <li className="nav-item">
                <button className="btn nav-link" onClick={handleSignupClick}>
                  Sign Up
                </button>
              </li>
            </ul>
          )}
        </div>
      </nav>

      <section className="container hero-section mt-4">
        {isLoggedIn ? ( // Show welcome message if logged in
          <>
            <h1>Welcome to Task Management</h1>
            {/* Add content for logged-in users here */}
          </>
        ) : (
          // Render the Login and Signup components conditionally
          <>
            {!showLogin && !showSignup && (
              <>
                <h1>Welcome to Task Management</h1>
                <button className="btn btn-primary mt-3">Get Started</button>
              </>
            )}
            {showLogin && <Login onLoginSuccess={handleLoginSuccess} />}
            {showSignup && <Signup />}
          </>
        )}
      </section>

      <footer className="mt-5 text-center">
        <p>&copy; 2023 Developed by Ganesh Mane</p>
      </footer>
    </div>
  );
}

export default App;
